import React from 'react'
import { useNavigate } from "react-router-dom";


const Info = (products) => {
    const navigate = useNavigate();
    function mainpage(){
        navigate("/");
    }
  return (
    <div>
        <h1>{products.title}</h1>
        <button onClick={mainpage}>Main Page</button>
    </div>
  )
}

export default Info
